import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom'
import Home from "./pages/Home"
function App() {
  return (
    <Router>
      <Route path="/" exact render={() => <Home />}></Route>

    </Router>
  );
}

export default App;
